import React from 'react';
import './App.css';


import {BrowserRouter, Route, Routes} from "react-router-dom";
import {DefaultLayout} from "./view/common/DefualtLayout/DefaultLayout";
import {Login} from "./view/pages/Login/Login";
function App() {
  return (
      <>

       <BrowserRouter>
         {/*<div className={"p-3 bg-amber-200 max-h-fit"}>*/}
         {/*<h1 className="pb-3 text-center text-primary text-7xl">This is App.tsx</h1>*/}
         <Routes>
           <Route path="/*" Component={DefaultLayout} > </Route>
           <Route path="/login" Component={Login}></Route>
         </Routes>

      </BrowserRouter> );    </>
  );
}

export default App;
